import React from 'react';
import {Provider} from 'react-redux';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import store from './store';
import homeAssemble from './start/homeAssemble';



ReactDOM.render(
  <Provider store={store}>
    <homeAssemble/>
    <App />
    </Provider>,
  document.getElementById('root')
);
